import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Colors from './Colors';
import Packages from './Packages';
import Orders from './Orders';

function App() {
  return (
    <Router>
      <div className="container">
        <h1 className="text-center my-4">颜料库存管理系统</h1>
        <nav className="nav justify-content-center mb-4">
          <Link className="nav-link btn btn-primary mx-2" to="/colors">库存管理</Link>
          <Link className="nav-link btn btn-success mx-2" to="/packages">套餐管理</Link>
          <Link className="nav-link btn btn-info mx-2" to="/orders">订单管理</Link>
        </nav>

        <Routes>
          <Route path="/colors" element={<Colors />} />
          <Route path="/packages" element={<Packages />} />
          <Route path="/orders" element={<Orders />} />
        </Routes>
      </div>
    </Router>
  );
}
